  return(
    <div>
      'Sorry the page you requested was not found'
    </div>
  )
}

function App() {
  return (
    <div className="App">
      {/* <Header/> */}
        <Switch>
            {/* <Route exact path='/' component={Register}/> */}
            <Route exact path='/recipe' component={RecipeContainer}/>
            {/* <Route exact path='/login' component={Login}/> */}
            <Route component = {My404}/>
        </Switch>
    </div>
  );
}

export default App;
